    public function __construct(BypassConfig $config)
    {
        if ($config->cookiesFile === null) {
            $this->cookiesJar = new CookieJar(false, $config->cookies);
        } else {
            $this->cookiesJar = new FileCookieJar($config->cookiesFile, true);
        }
        $this->headers = $config->headers;

        $this->client = new Client([
            'http_errors' => false,
            'timeout' => 10,
            'verify' => false,
            'headers' => [
