        ]);
    }

    /**
     * Send GET request
     *
     * @param string $url
     *
     * @return ResponseInterface
     */
    public function get(string $url): BypassResult
    {
        return $this->bypass($url);
    }

    /**
     * Send POST request
     *
     * @param string $url
     * @param array<string, mixed> $data
     *
     * @return BypassResult
     */
    public function post(string $url, array $data = []): BypassResult
    {
        return $this->bypass($url, 'POST', $data);
    }

    /**
     * Send a request
     *
     * @param string $url
     * @param string $method
     * @param array<string, mixed> $data
     *
     * @return ResponseInterface
     */
    public function bypass(string $url, string $method = 'GET', array $data = []): BypassResult
    {
        $url = rtrim($url, '/');
        $response = $this->sendRequest($url, $method, $data);

        if ($response->getStatusCode() !== 403) {
            return new BypassResult(true, $response);
        }

        $urlComponents = parse_url($url);
        $scheme = $urlComponents['scheme'];
        $domain = "$scheme://" . $urlComponents['host'];

        $this->sendRequest($domain . '/.well-known/ddos-guard/check?context=free_splash');

        $response = $this->getCheckData($domain);
        if ($response->getStatusCode() === 200) {
            $response = $this->sendRequest($url, $method, $data);
            if ($response->getStatusCode() === 200) {
                return new BypassResult(true, $response);
            }
        }

        return new BypassResult(false, $response);
    }

    private function sendRequest(string $url, string $method = 'GET', array $data = []): ResponseInterface
    {
        $options = [
            'cookies' => $this->cookiesJar,
            'headers' => $this->headers,
        ];
        if (in_array($method, ['POST', 'PUT', 'PATCH'])) {
            $options['json'] = $data;
        }

        return $this->client->request($method, $url, $options);
    }

    /**
     * Get and send check data
     *
     * @param string $domain
     *
     * @return ResponseInterface
     */
    private function getCheckData(string $domain): ResponseInterface
    {
        $response = $this->client->get('https://check.ddos-guard.net/check.js');;
        if ($response->getStatusCode() !== 200) {
            return $response;
        }

        $scripts = explode("'", $response->getBody()->getContents());
        $this->sendRequest($domain . $scripts[1]);
        $this->client->get($scripts[3]);
        sleep(2);

        return $this->sendRequest($domain . '/.well-known/ddos-guard/mark/', 'POST', $this->getPayload());
    }

